      out.write("                                    function soloLetras(e) {\r\n");
      out.write("                                        key = e.keyCode || e.which;\r\n");
      out.write("                                        tecla = String.fromCharCode(key).toLowerCase();\r\n");
      out.write("                                        letras = \" áéíóúabcdefghijklmnñopqrstuvwxyz\";\r\n");
      out.write("                                        especiales = [8, 37, 39, 46];\r\n");
      out.write("\r\n");
      out.write("                                        tecla_especial = false;\r\n");
      out.write("                                        for (var i in especiales) {\r\n");
      out.write("                                            if (key === especiales[i]) {\r\n");
      out.write("                                                tecla_especial = true;\r\n");
      out.write("                                                break;\r\n");
      out.write("                                            }\r\n");
      out.write("                                        }\r\n");
      out.write("\r\n");
      out.write("                                        if (letras.indexOf(tecla) === -1 && !tecla_especial)\r\n");
      out.write("                                            return false;\r\n");
      out.write("                                    }\r\n");
      out.write("                                    \r\n");
      out.write("                                                                      \r\n");
      out.write("                                    function validar() {\r\n");
      out.write("                                        var cad = document.getElementById(\"txt-ced\").value.trim();\r\n");
      out.write("                                        var total = 0;\r\n");
      out.write("                                        var longitud = cad.length;\r\n");
      out.write("                                        var longcheck = longitud - 1;\r\n");
      out.write("\r\n");
      out.write("                                        if (cad !== \"\" && longitud === 10) {\r\n");
      out.write("                                            for (i = 0; i < longcheck; i++) {\r\n");
      out.write("                                                if (i % 2 === 0) {\r\n");
      out.write("                                                    var aux = cad.charAt(i) * 2;\r\n");
      out.write("                                                    if (aux > 9)\r\n");
      out.write("                                                        aux -= 9;\r\n");
      out.write("                                                    total += aux;\r\n");
      out.write("                                                } else {\r\n");
      out.write("                                                    total += parseInt(cad.charAt(i)); // parseInt o concatenará en lugar de sumar\r\n");
      out.write("                                                }\r\n");
      out.write("                                            }\r\n");
      out.write("\r\n");
      out.write("                                            total = total % 10 ? 10 - total % 10 : 0;\r\n");
      out.write("\r\n");
      out.write("                                            if (cad.charAt(longitud - 1) === total) {\r\n");
      out.write("                                            } else {\r\n");
      out.write("                                                alert(\"LA CEDULA NO EXISTE O ES INCORRECTA\");\r\n");
      out.write("                                                document.getElementById(\"txt-ced\").value = \"\";\r\n");
      out.write("                                            }\r\n");
      out.write("                                        }\r\n");
      out.write("                                    }\r\n");
      out.write("                                    \r\n");
      out.write("                                    function verificarCedula(cedula) {\r\n");
      out.write("                                        if (typeof (cedula) === 'string' && cedula.length === 10 && /^\\d+$/.test(cedula)) {\r\n");
      out.write("                                            var digitos = cedula.split('').map(Number);\r\n");
      out.write("                                            var codigo_provincia = digitos[0] * 10 + digitos[1];\r\n");
      out.write("\r\n");
      out.write("                                            //if (codigo_provincia >= 1 && (codigo_provincia <= 24 || codigo_provincia == 30) && digitos[2] < 6) {\r\n");
      out.write("\r\n");
      out.write("                                            if (codigo_provincia >= 1 && (codigo_provincia <= 24 || codigo_provincia === 30)) {\r\n");
      out.write("                                                var digito_verificador = digitos.pop();\r\n");
      out.write("\r\n");
      out.write("                                                var digito_calculado = digitos.reduce(\r\n");
      out.write("                                                        function (valorPrevio, valorActual, indice) {\r\n");
      out.write("                                                            return valorPrevio - (valorActual * (2 - indice % 2)) % 9 - (valorActual === 9) * 9;\r\n");
      out.write("                                                        }, 1000) % 10;\r\n");
      out.write("                                                return digito_calculado === digito_verificador;\r\n");
      out.write("                                            }\r\n");
      out.write("                                        }\r\n");
      out.write("                                        return false;\r\n");
      out.write("                                    }\r\n");
      out.write("                                    const fechaNacimiento= document.getElementById(\"txt-fechaNacimiento\");\r\n");
      out.write("                                 \r\n");
      out.write("                                 const calcularEdad=(fechaNacimiento) => {\r\n");
      out.write("                                     const fechaActual=new Date();\r\n");
      out.write("                                     const anoActual=parseInt(fechaActual.getFullYear());\r\n");
      out.write("                                     const mesActual=parseInt(fechaActual.getMonth())+1;\r\n");
      out.write("                                     const diaActual=parseInt(fechaActual.getDate());\r\n");
      out.write("                                     \r\n");
      out.write("                                     const anoNacimiento=parseInt(String(fechaNacimiento).substring(0,4));\r\n");
      out.write("                                     const mesNacimiento=parseInt(String(fechaNacimiento).substring(5,7));\r\n");
      out.write("                                     const diaNacimiento=parseInt(String(fechaNacimiento).substring(8,10));\r\n");
      out.write("                                     \r\n");
      out.write("                                     let edad=anoActual-anoNacimiento;\r\n");
      out.write("                                     if(mesActual<mesNacimiento){\r\n");
      out.write("                                         edad--;\r\n");
      out.write("                                     }else if(mesActual===mesNacimiento){\r\n");
      out.write("                                         if(diaActual<diaNacimiento){\r\n");
      out.write("                                             edad--;\r\n");
      out.write("                                         }\r\n");
      out.write("                                     }\r\n");
      out.write("                                     return edad;\r\n");
      out.write("                                 };\r\n");
      out.write("                                 \r\n");
      out.write("                                 window.addEventListener('load', function() {\r\n");
      out.write("                                     fechaNacimiento.addEventListener('change',function() {\r\n");
      out.write("                                         if(this.value){\r\n");
      out.write("                                             $(\"#txt-edadP\").val(calcularEdad(this.value));\r\n");
      out.write("                                         }\r\n");
      out.write("                                     });\r\n");
      out.write("                                 });\r\n");
